import { createReducer, on } from "@ngrx/store"
import { addToActive, addToPassed } from "./car.actions"
import { CarInterface } from "src/app/interfaces/car.interface"

export interface carState  {
  activeCars: CarInterface[],
  passedCars: CarInterface[],
}

export const initialState: carState = {
  activeCars: [
    {
      img: 'data:image/jpeg;base64,',
      id: 1,
   },
    {
      img: 'data:image/jpeg;base64,',
      id: 2,
    },
    {
      img: 'data:image/jpeg;base64,',
      id: 3,
    }
  ],
  passedCars: [],
}

const _carReducer = createReducer(
  initialState,
  on(addToPassed, (state, { car }) => ({
    ...state,
    activeCars: state.activeCars.filter(activeCar => activeCar.id !== car.id),
    passedCars: [...state.passedCars, car],
  })),
  on(addToActive, (state, { car }) => ({
    ...state,
    activeCars: [...state.activeCars, car],
    passedCars: state.passedCars.filter(passedCar => passedCar.id !== car.id),
  })),
)

export function carReducer(state: any, action: any) {
  return _carReducer(state, action);
}
